import React, { useState, useEffect } from 'react';
import DoctorCard from './doccard';

function DoctorPage() {
    const [doctors, setDoctors] = useState([]);

    useEffect(() => {
        fetch('http://localhost:3002/SignUp/view')
            .then(response => response.json())
            .then(data => setDoctors(data))
            .catch(error => console.error('Error:', error));
    }, []);

    return (
        <div>
            <h1>Doctors</h1>
            <div style={{display:'flex',justifyContent:'s'}}>
            {doctors.map(doctor => (
              <a href='/profile' style={{textDecoration:'none',color:'black'}}>  <DoctorCard key={doctor._id} doctor={doctor} /></a>
            ))}
            </div>
        </div>
    );
}

export default DoctorPage;
